!function(){"use strict";$.getJSON(window.apiUrl+"/restaurants/list/"+window.username+"/?following=true",function(i){var t=$(".template").children().first().clone();$.each(i,function(i,e){var n=t.clone();n.find(".name").text(e.name),n.find(".price-range .low").text(e.price_low),n.find(".price-range .high").text(e.price_high),n.find(".address").text(e.location_name),n.find(".photo img").attr("src","images/"+e.photo),n.find(".get-there-button").wrap('<a href="directions.html?id='+e.id+'"></a>'),n.find(".photo, .info").wrap('<a href="restaurant.html?id='+e.id+'"></a>'),$(".main-div").append(n)})})}();